import './App.css';
import Home from './components/Home';
import Babyplanner from './components/Babyplanner';
import Dashboard from './components/Dashboard';
import { Routes, Route} from 'react-router-dom';
import { useState } from 'react';
import 'react-toastify/dist/ReactToastify.css';
import json from './data.json'

function App() {
  const [showText, setShowText] = useState(false)
  const [data, setData] = useState(json)
  const femaleFilter = () =>{
    let babyGender = json.baby.filter(i => i.gender === 'Female')
    setData(babyGender)
  }
  const maleFilter = () =>{
    let babyGender = json.baby.filter(i => i.gender === 'Male')
    setData(babyGender)
  }

  return (
    <div className="App">



      {/* <p onClick={() => {setShowText(!showText)}}><p onClick={femaleFilter}>Female</p></p>
      <p onClick={() => {setShowText(!showText)}}><p onClick={maleFilter}>Male</p></p> */}
